import React from "react"
import Footer from "../components/footer/Footer"

import Header from "../components/header/Header"

class Home extends React.Component {
  render() {
    return (
      <>
        <Header nav_select={"cad"} />
        <img src="Plan1.jpg" alt="" />
        <Footer />
      </>
    )
  }
}

export default Home
